export NEWT_COLORS='
title=black,
'

name="fluxcore-linux-amd64"

clear_screen() {
  clear
}

check_command() {
  local command=$1
  local package=$2
  if ! command -v $command >/dev/null 2>&1; then
    echo "$command is not installed. Installing $package..."
    sudo apt-get -qq update
    sudo apt-get install -y $package
    echo "$package has been installed."
  else
    echo "$command is already installed."
  fi
}

get_local_ip() {
  ip_list=($(ip addr show | grep 'inet ' | awk '{print $2}' | cut -d'/' -f1 | uniq))
  elements=${#ip_list[@]}
  choices=();
  for (( i=0;i<$elements;i++)); do
    if [[ "$i"  == "0" ]]; then
      choices+=("${ip_list[i]}" "" "ON");
    else
      choices+=("${ip_list[i]}" "" "OFF");
    fi
  done;
  IP=$(whiptail --title "Which IP to bind for pouwfrontend web server?"         \
           --radiolist " \n Use the UP/DOWN arrows to highlight the IP you want. Press Spacebar on the IP you want to select, THEN press ENTER." 25 55 10 \
           "${choices[@]}" \  3>&2 2>&1 1>&3 );
}


daemon_setup() {
  clear_screen
  echo "Fluxcore for Linux AMD64"
  echo "Please allow privileges to access hardware info to the program."
  
  sudo -nv 2>/dev/null
  sudo_status=$?

  if [ $sudo_status -eq 1 ]; then
    echo "Sudo requires a password. Please enter your password."
    if ! sudo -v; then
      echo "Incorrect sudo password. Exiting script."
      exit 1
    fi
  elif [ $sudo_status -ne 0 ]; then
    echo "You do not have sudo privileges. Exiting script."
    exit 1
  fi
  
  sudo useradd -p "" -r -s /bin/bash -m fluxuser
  echo "fluxuser ALL=(ALL:ALL) NOPASSWD: ALL" | sudo tee "/etc/sudoers.d/dont-prompt-fluxuser-for-sudo-password"
  sudo systemctl stop fluxcore.service
  sudo systemctl disable fluxcore.service
  sudo curl -o /home/fluxuser/$name https://download.fluxcore.ai/$name
  sudo chown fluxuser:fluxuser /home/fluxuser/$name && sudo chmod +x /home/fluxuser/$name
  sudo setcap 'CAP_DAC_READ_SEARCH+eip cap_net_bind_service=+ep' /home/fluxuser/$name
  sudo chmod u+s,+x /home/fluxuser/$name
  echo "Installing fluxcore service"
  get_local_ip
  IP=${IP:-127.0.0.1}
  sudo curl -o /lib/systemd/system/fluxcore.service https://download.fluxcore.ai/fluxcore.service
  sudo sed -i "s/127.0.0.1/$IP/g" /lib/systemd/system/fluxcore.service
  sudo systemctl daemon-reload
  sudo systemctl enable fluxcore.service
  sudo systemctl start fluxcore.service
  systemctl status --no-pager fluxcore.service
  echo
  echo "You can access it here: http://$IP:18180"
  echo "Be aware to sign in, third parties like Github, Google, etc. require you to have a domain name."
  echo "You can add the IP of your remote to the host file under the name 'machine1.remote.fluxcore', 'machine2.remote.fluxcore', 'machine3.remote.fluxcore'."
}

unistall() {
 clear_screen
 UBUNTU_VERSION=$(lsb_release -rs)
 echo "Detected Ubuntu version: $UBUNTU_VERSION"
 echo "Please allow privileges to remove program"
 sudo -nv 2>/dev/null
 sudo_status=$?

 if [ $sudo_status -eq 1 ]; then
   echo "Sudo requires a password. Please enter your password."
   if ! sudo -v; then
     echo "Incorrect sudo password. Exiting script."
     exit 1
   fi
 elif [ $sudo_status -ne 0 ]; then
   echo "You do not have sudo privileges. Exiting script."
   exit 1
 fi
 sudo systemctl stop fluxcore.service
 sudo systemctl disable fluxcore.service
 sudo rm /home/fluxuser/$name
 sudo rm /lib/systemd/system/fluxcore.service
 sudo systemctl daemon-reload
 sudo deluser --remove-home fluxuser
 sudo /usr/local/bin/rke2-uninstall.sh || true
 sudo rm -rf /etc/ceph \
	/etc/cni \
	/etc/kubernetes \
	/etc/rancher \
	/opt/cni \
	/opt/rke \
	/run/secret/kubernetes.io \
	/run/calico \
	/run/flannel \
	/var/lib/calico \
	/var/lib/etcd \
	/var/lib/cni \
	/var/lib/kubelet \
	/var/lib/rancher\
	/var/log/containers \
	/var/log/kube-audit \
	/var/log/pods \
	/var/run/calico
 echo "Uninstall $name daemon"
}

fix_frankenstein() {
  curl -o fix-frankenstein.sh https://pouwdev.runonflux.io/update/fix-frankenstein.sh
  bash fix-frankenstein.sh
}

check_command "lsb_release" "lsb-release"
check_command "wg-quick" "wireguard wireguard-tools udhcpc"

if ! command -v whiptail &> /dev/null; then
  sudo apt-get update -y 
  sudo apt-get install -y whiptail
fi

UBUNTU_VERSION=$(lsb_release -rs)
echo "Detected Ubuntu version: $UBUNTU_VERSION"
clear_screen

echo -e "$Banner"
echo -e "=================================================================================================================[PRODUCTION]"
echo -e "1) Install FluxCore"
echo -e "2) Unistall FluxCore"
echo -e "3) Fix Frankenstein Script"
echo -e "============================================================================================================================="
read -rp "Pick an option and hit ENTER: "
case "$REPLY" in
 1)  
		clear
		sleep 1
		daemon_setup

 ;;
 2) 
		clear
		sleep 1
		unistall
 ;;
 3)     
		clear
		sleep 1
		fix_frankenstein
 ;;
 esac
